Here are the updated photos of the last project we completed. 

All sand and grout has been completed for the paved areas.

Planting and turf have really taken well as you can see from the wind the blossom is slowly disappearing. 

It was really nice to step away and come back to the project and get that feeling of accomplishment again. I'm very proud of this.

