I wanted to get a post out quickly as it's been a long time since I've given any update on the current project. 

We are now very close to the finish line!! Just grouting, painting and sanding left to do. 

This past week everything has really come together and everything looks more like a garden and less like a work site which is refreshing.

I'll get some better pictures and everything soon just wanted to get a post out so people can see the progress.

Plus there's the front which is still unfinished awaiting scaffold to come down. 

